import React, {Component} from 'react';

class Item_github extends Component {
    render() {
        const {user}=this.props
        return (
            <div>
                <div className="card">
                    <a rel="noreferrer" href={user.html_url} target="_blank">
                        <img alt="head_picture" src="https://avatars.githubusercontent.com/u/6412038?v=3" style={{width:'100px'}}/>
                    </a>
                    <p className="card-text">{user.id}</p>
                </div>
            </div>
        );
    }
}

export default Item_github;
